std::vector<int> co_oCCur::AlignFP::arange(int lb, int ub)
{
    std::vector<int> arangeIt;

    arangeIt.clear();
    arangeIt.reserve(ub - lb + 1);

    for (auto i = lb; i < ub; i++) {
        arangeIt.emplace_back(i);
    }

    return arangeIt;
}

